\

\begin{equation}
ds^2 = e^{2V}(-dt^2 + dz^2) + e^{2W}(dr^2 + r^2 d\Omega_k^2)\,,
       \label{metric}
\

\begin{equation}
F^I_{\theta\phi} = k q^I F_k(\theta)\,, \qquad
A^I_{\phi} = k q^I \int F_k(\theta) d\theta\,. \label{magnfields}
\

\begin{equation}
- e^{-2W} \frac{k}{r^2} G_{IJ} q^J + \frac 32 e^{-W} \partial_r X_I +
3gV_I = \gamma(r) X_I\,, \label{eqgamma}
\

\begin{equation}
- e^{-2W} \frac{k}{r^2}G_{IJ} q^J + \frac 32 e^{-W} \partial_r X_I + 3g V_I
+ 3 e^{-W} X_I V' = 0\,. \label{flowequ}
\

\begin{equation}
\frac 12 e^{-W} X_I' + g V_I + e^{-W} X_I (W' + r^{-1}) = 0\,, \label{flowk=0}
\

\begin{equation}
X_I = e^{-2W} r^{-2} [-2 g V_I  \int e^{3W} r^2 dr + C_I]\,, \label{X_IW}
\

\begin{equation}
y(u) = -9a \int e^{3(W + u)} du + \frac 92 g^2 b\,,
\

\begin{equation}
g_2 = 243 g^4 (b^2 - ac)\,, \qquad g_3 = \frac{729}{2} g^6 (3abc - a^2 d - 2b^3)\,.
\

\begin{equation}
ds^2 = {\dot f}^{\frac 23}[- g^2 dt^2 + g^2 dz^2 + du^2 + d\Omega_0^2]\,,
       \label{metrweier}
\

\begin{equation}
f(u) = g^{-3}\int e^{3(W + u)} du = -\frac{y(u)}{9g^3 a} + \frac{b}{2g a}\,.
       \label{f}
\

\begin{equation}
\ln X_I - \ln X_I^0 = \frac 92 g^2 \left[\frac{C_I}{V_I} a - b\right] u^2 + {\cal O}(u^4)\,,
                      \label{expansionscal}
\

\begin{equation}
- e^{-2W} \frac{k}{r^2}G_{IJ} q^J + 3g V_I + 3 e^{-W} X_I V' = 0\,. \label{flowfix}
\

\begin{equation}
V' = \frac{1}{2r^2} kZ e^{-W} - g X^I V_I e^W\,. \label{Vprime}
\

\begin{equation}
e^{-2W} \frac{k}{r^2}(-G_{IJ}q^J + \frac 32 Z X_I) + 3g (V_I - X_I X^J V_J) = 0\,.
\

\begin{equation}
ds^2 = \frac{k}{\cos(p\ln gr)\sin^2(p\ln gr)} (-dt^2 + dz^2) +
       \frac{3kZ^2}{r^2}\cot^2(p\ln gr)(dr^2 + r^2 d\Omega_k^2)\,, \label{finalmetr}
\

\begin{equation}
ds^2 = e^{2V}(dx^2 + dy^2) + e^{2W}(dr^2 + r^2 d\sigma_k^2)\,,
\

\begin{equation}
f_k(\theta) = \left\{\begin{array}{l@{\,,\quad}l}
                     1 & k=0 \\ \sinh t & k = 1 \\ \sin t & k = -1\,.
                     \end{array} \right.
\

\begin{equation}
